          "id": "a7bf193a0a12cf3a17917af38de21561ff14b86d",
          "message": "Add large models and large model runners to benchmarks (#62)\n\nSUMMARY:\r\nAdd `mistralai/Mixtral-8x7B-Instruct-v0.1` to the large model\r\nbenchmarks, and also run the large model benchmarks on the quad-A100\r\nrunner.\r\n\r\nThe key changes to enable running the additional large model are:\r\n* Installing `build-essential` via `apt` as this model requires having a\r\nC compiler at runtime\r\n* Implementing a graceful shutdown approach so the server can perform\r\nits standard shutdown processes\r\n* This starts by attempting to send the interrupt signal (SIGINT, same\r\nsignal as pressing Ctrl-C would send), then escalates to SIGTERM and\r\nSIGKILL. After each signal, the server is given time to shut down prior\r\nto the next signal being sent.\r\n* Forcing use of the model cache (was occasionally getting OSError 524\r\nwithout it due to the way the benchmark script attempts to pre-download)\r\n* If desired, I can whip up a small script to pre-download the models\r\nprior to running the benchmarking to guard against cache misses â€” the\r\ntest run manually downloaded the models (though both were already in\r\ncache) prior to running the benchmarks.",
